import { Injectable } from '@angular/core';
import { Product } from 'src/app/ProductsModule/Core/Domain/Entities/Product';
import { IProductsRepository } from 'src/app/ProductsModule/Core/Domain/Repositories/IProductsRepository';
import { products } from 'src/app/products';

@Injectable({
  providedIn: 'root'
})
export class ProductsRepositoryService implements IProductsRepository {

  getProducts(): Product[] {
    return products;
  }
}
